import string

def linear_dict(alpha, matrix): 
     linearized = [] 
     for c1 in alpha: 
         for c2 in alpha: 
             try: 
                 linearized.append(matrix[(c1, c2)]) 
             except: 
                 linearized.append(-50) 
     return linearized 


